import React from "react";
import "./AlertMessage.css";

const Notification = ({ name }) => {
  return (
    <div class="wrapper">
      <h2>Contact of {name} is already in the list.</h2>
      <p>Please enter the number which is not in the list.</p>
    </div>
  );
};

export default Notification;
